import React, {Component} from 'react';

class StudentsList extends React.Component {
    render() {
        return (
            <div class = 'studentsList'>
                <p class = 'student'>Яна Айвазовская</p>
                <p class = 'student'>Леонид Шипков</p>
                <p class = 'student'>Галина Войтех</p>
                <p class = 'student'>Олег Мельковский</p>
                <p class = 'student'>Ксения Хорошева</p>
                <p class = 'student'>Евгений Бажов</p>
                <p class = 'student'>Ева Набокова</p>
                <p class = 'student'>Афанасий Устоев</p>
            </div>
        );
    }

}

export default StudentsList;
